import React from 'react';
import ReactDOM from 'react-dom';
import './css/App.css';
import App from './js/components/App';
import * as serviceWorker from './js/serviceWorker';

const app = () => 
    ReactDOM.render(
        <App />, 
        document.getElementById('root')
    );

app();
serviceWorker.unregister();
